import { Image } from 'antd';


function PhotoList(props) {
    return (
      <div className="photo-List">
            <Image.PreviewGroup>
            <Image
                width={200}
                src={props.photo.image}
            />
            <Image
                width={200}
                src="https://gw.alipayobjects.com/zos/antfincdn/aPkFc8Sj7n/method-draw-image.svg"
            />
            </Image.PreviewGroup>
      </div>

    );
  }

  export default PhotoList;
